def update_figure():
    global current_figure_index, root, canvas
    current_figure_data = figure_data_list[current_figure_index]
    canvas.delete("all")  # Clear the previous figure
    for row in range(len(figure_data1)):
        for col in range(len(figure_data1[0])):
            x1 = col * 5
            y1 = row * 5
            x2 = x1 + 5
            y2 = y1 + 5
            color = "black" if current_figure_data[row][col] else "white"
            canvas.create_oval(x1, y1, x2, y2, fill=color, outline="black" if current_figure_data[row][col] else "white")
    current_figure_index = (current_figure_index + 1) % len(figure_data_list)
    root.after(100, update_figure)  # Call update_figure again after 200 milliseconds

root, canvas = create_pixel_grid(rows=len(figure_data1), cols=len(figure_data1[0]), pixel_size=5, figure_data=figure_data1)
update_figure()
root.mainloop()
